import React from "react";
import { Redirect, Route } from "react-router-dom";
import { getAccessToken } from "../utils/LocalStorage";

const Root = (props) => {
  const token = getAccessToken();
  return token ? (
    <Route path={props.path} component={props.component} />
  ) : (
    <Redirect to="/login" />
  );
};

export default Root;
